import React from "react";
import { useParams } from "react-router-dom";

const ProductDetail = () => {
  const { id } = useParams();

  return (
    <div className="container mt-4">
      <h1>Ürün Detayı - ID: {id}</h1>
      <p>Burada platform karşılaştırmaları ve grafikler gösterilecek.</p>
    </div>
  );
};

export default ProductDetail;
